package Java_MarchSession;

public class Vid6_TwoDimArray {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int data[][]= {{10,20,3}, {2,3,4}, {2,4,5} };
		
		for(int i=0;i<3;i++){
			for(int j=0;j<3;j++){
				System.out.print(data[i][j]+ " ");
			}
			System.out.println();
		}
		

	}

}
